import styled from 'styled-components';

const PrettyDiv = styled.div`
    border: 2px solid black;
    border-radius: 5px;
    padding: 10px;
    margin: 10px;
    box-shadow: 5px 5px 5px 0px lightgreen;
    float: left;
`;

const Newh2 = styled.h2`
    background-color: greenyellow;
    border-radius: 5px;
    padding: 10px;
    margin: 10px;
    box-shadow: 5px 5px 5px 0px yellow;
`
















export default { PrettyDiv, Newh2 };
